//Component to hold yelp cards for restaurant, coffee, and weather
import React from "react";
import "./Card.css";

const Card = props => (
    <div class="card">
        <div class="card-image">
            <img id="restaurant-img"></img>
            <span class="card-title" id="restaurant-name"></span>
            <a class="btn-floating halfway-fab waves-effect waves-light red" id="more-weather" value="weather"><i class="material-icons">brightness_5</i></a>
        </div>
        <div class="card-content" id="weather-results">
            <p>{props.name}</p>
        </div>
        <div class="card-action">
            <a href="#"></a>
        </div>
    </div>
);
export default Card;
